window.bookSummaryJSON = "<p><i>“You’ll always be mine.”</i></p> <p>The latest taunt from my stalker reminded me I was nothing more than a possession to my father, to the Reapers, to Archer D’Ath. Even to Kody and Steele. Princess Danvers - the prize.</p> <p>His wife.</p> <p>Archer D’Ath’s wife.</p> <p>I hate them. They lied to me. Over and over again. I knew they were lying, and I hate myself for letting it happen. For believing in the fake relationships I want so desperately to be real.</p> <p>Fake. It’s all f--king fake. My stalker won’t let me go. None of them will. Archer and his boys think they control me. My stalker wants to possess me. I’m not an idiot, I know my newest allies are using me, too.</p> <p>That’s fine. I’ll use all of them. I’ll use them to take back what’s mine. My life. My freedom. My name.</p> <p>No one owns Madison Kate Danvers.</p> <p><i>Fake </i>is a full-length college/new-adult romance with enemies-to-lovers/love-hate themes. This is a reverse-harem novel, meaning the main character has more than one love interest. This is book three of four in the series.</p>"; 
